import React from "react";
import { Navbar, Nav } from "react-bootstrap";

function CustomNavbar({ user, onNavigateHome, onNavigateProfile, onLoginClick }) {
  const handleBrandClick = () => {
    if (user) {
      if (onNavigateProfile) {
        onNavigateProfile();
      }
    } else {
      if (onNavigateHome) {
        onNavigateHome();
      }
    }
  };

  return (
    <Navbar className="navbar-custom" expand="lg">
      <Navbar.Brand href="#" className="navbar-brand" onClick={handleBrandClick}>
        IMS
      </Navbar.Brand>
      <Nav className="ms-auto">
        {user ? (
          <button className="btn icon-btn" onClick={() => onNavigateProfile()}>
            <img
              src="images/icons/profile/profile-32.png"
              alt="Profile"
              className="icon-img"
            />
          </button>
        ) : (
          <button className="btn icon-btn" onClick={() => onLoginClick()}>
            <img
              src="images/icons/loginregister/loginregister-32.png"
              alt="Login/Register"
              className="icon-img"
            />
          </button>
        )}
      </Nav>
    </Navbar>
  );
}

export default CustomNavbar;
